import React, {Component} from 'react';
import Plx from "react-plx";
import { translate } from "react-translate";


class OurProcess extends Component {
    render(){
        let {Â t } = this.props;
        const ParallaxProcess = [
            {
              start: 'self',
              duration: 300,
              properties: [
                
                  {
                    startValue: 15,
                    endValue: 0,
                    property: "padding-right"
                  },
                  {
                    startValue: 15,
                    endValue: 0,
                    property: "padding-left"
                  }
              ]
            }
        ];

        const ParallaxProcessTwo = [
            {
              start: 'self',
              duration: 300,
              properties: [
                
                {
                    startValue: 15,
                    endValue: 0,
                    property: "padding-right"
                  },
                  {
                    startValue: 15,
                    endValue: 0,
                    property: "padding-left"
                  }
              ]
            }
        ];
        
        return(
        <div >
            <section className="chat_clients_area" id="process">
                <div className="container-fluid">
                
                    <div className="row">
                    <Plx className="col-md-6" parallaxData={ParallaxProcess}>
                        <div className="p-0 chat_clients_feedback">
                        <a className="w-100" href="/scrum">
                            <div className="clients_feedback_item">

                                <div className="feedback_body">
                                <h3 className="f_name">Scrum</h3>
                                    <p>{t(this.props.process_d)}</p>
                                    <a href="/scrum" className="learn_btn"><strong>{t(this.props.read_more)}</strong></a>
                                </div>
                                <img src={require("../img/home-chat/img-scrum.png").default} alt=""/>
                            </div></a>
                        </div>
                    </Plx>
                    <Plx className="col-md-6" parallaxData={ParallaxProcessTwo}>
                        <div className="p-0 chat_clients_feedback process_two">
                            <a className="w-100" href="/devops">
                                <div className="clients_feedback_item">
                                    <div className="feedback_body col">
                                    <h3 className="f_name">Devops</h3>
                                        <p>{t(this.props.process2_d)}</p>
                                        <a href="/devops" className="learn_btn"><strong>{t(this.props.read_more)}</strong></a>
                                    </div>
                                    <div className="col">
                                        <img className=" paddingg" src={require("../img/home-chat/img-devops.png").default} alt=""/>
                                    </div>
                                </div>
                            </a>
                        </div>
                    </Plx>
                    </div>
                </div>
            </section>
        </div>
        )
    }
}

export default translate('process_home')(OurProcess);
